import React from "react";
import { Header, Icon, Image } from "semantic-ui-react";

const Feed = () => (
  <Header as="h4">
    <Image src="https://picsum.photos/40/40" avatar />
    <Header.Content>
      <Header.Subheader>
        Annual Financial Report <span style={{fontSize:'5px'}}>5 sec</span>
      </Header.Subheader>
      Alan Schneider
    </Header.Content>
  </Header>
);

export default Feed;
